  "description": "Karl-Olof Högsell was a district physician from Sweden who was born on March 29, 1896 in Nybro to district judge Axel H. and Tora Forsell. He married Dagmar Booge in 1934 and they had an adopted son named Gunnar who was born in 1935. Högsell studied medicine in Kalmar until 1914, then obtained a degree in medicine in Stockholm in 1919 and a medical license in 1924. He served in various medical organizations in different positions, including Temporary Assistant Physician at Kalmar Hospital from 1924 to 1925, Assistant Physician at Ystad Hospital from 1925 to 1926, First Temporary Assistant Physician at Jönköping Hospital from 1926 to 1928, and as Temporary Hospital Physician in Ystad and Kalmar, and at the Surgical Department in Jönköping for a total of six months. He also worked as an Assistant at Sabbatsberg Hospital Medical Department in 1927, Temporary District Physician in Karlshamn in 1928, District Physician in Töcksmark from 1929 to 1933, in Åseda from 1933 to 1946, and as District Physician and Assistant Chief District Physician in Kalmar since 1947. Högsell was also Vice-Chairman of the Municipal Council in Åseda from 1939 to 1942 and a Member of the Municipal Council in Åseda town from 1943 to 1946. He has several presentations and articles on health issues."
